import React from 'react';
import './css/style.css'

function App() {
  return (
    <div className="App">

      <div class="sidebar">
        <a class="active" href="#home">Home</a>
        <a href="#news">News</a>
        <a href="#contact">Contact</a>
        <a href="#about">About</a>
      </div>
    </div>
  );
}

export default App;
